import React, { useEffect } from 'react'
import { useParams } from 'react-router'

export default function ModifyCar() {

    const { id } = useParams()

    useEffect(() => {
        fetch('http://localhost:3080/getCarInfo', {
            method: "POST",
            headers: {
                'Content-Type': 'application/json'
            },
            body: {
                token: localStorage.getItem("token"),
                id: id
            }
        })
    }, [])

    return(
        <div>
            <h2>Modify a Car</h2>
        </div>
    )
}
